import React from "react";

import opponents from "./Opponents";

const level = () => {
  const levels = [
    "NOVICE",
    "CLASS A",
    "CLASS B",
    "CLASS C",
    "CLASS D",
    "CANDIDATE MASTER",
    "GRAND MASTER",
  ];

  const nyoba = opponents.filter((e) => e.level === levels[6]);

  console.log(nyoba);
  return (
    <div className="d-flex justify-content-between">
      <button className="candidate">NOVICE</button>
      <button className="candidate">CLASS A</button>
      <button className="candidate">CLASS B</button>
      <button className="candidate">CLASS C</button>
      <button className="candidate">CLASS D</button>
      <button className="candidate">CANDIDATE MASTER</button>
      <button className="candidate">GRAND MASTER</button>
    </div>
  );
};

export default level;
